    tokens = [{"type":"raw","value":"<a href=\"#acrobatic\">\r\n  <h3 id=\"acrobatic\">Acrobatie</h3>\r\n</a>\r\n\r\n<p>\r\n  <span class=\"badge badge-primary\">Dextrit</span>\r\n  <span class=\"badge badge-secondary\">Force</span>\r\n</p>\r\n\r\n<p>\r\n  La matrise de l'<strong>acrobatie</strong> apprcie la capacit  utiliser\r\n  son corps de manire ingnieuse mais dangereuse pour s'extirper de situations\r\n  dlicates. Sauter en travers d'un ravin, passer sous les jambes d'un\r\n  adversaire ou courrir en terrain difficile sont des exemples de situation o\r\n  un test d'acrobatie est ncssaire.\r\n</p>\r\n\r\n<p>\r\n  Une <strong>acrobatie</strong> ralise contre l'environnement se fait contre\r\n  le degr de difficult de celui-ci. Dans le cas o\r\n  l'<strong>acrobatie</strong> vise un autre personnage, les rgles de\r\n  l'<strong>esquive</strong> et de la <strong>parade</strong> s'appliquent en\r\n  opposition avec le niveau de matrise de l'acrobate. Certaines manoeuvres\r\n  peuvent ncssiter de raliser un test en opposition avec leur propre degr\r\n  de difficult avant tout autre test.\r\n</p>\r\n\r\n<table class=\"table\">\r\n  <thead>\r\n    <tr>\r\n      <th colspan=\"2\">Atouts</th>\r\n    </tr>\r\n  </thead>\r\n  <tbody>\r\n    <tr>\r\n      <td><strong>Parkour</strong></td>\r\n      <td>Acrobatie: 4+</td>\r\n    </tr>\r\n    <tr>\r\n      <td colspan=\"2\">\r\n        Lorsqu'une acrobatie est ralise dans le but de se dplacer rapidement\r\n        en terrain difficile, celle-ci se voie attribuer une bonus de +10%.\r\n      </td>\r\n    </tr>\r\n    <tr>\r\n      <td><strong>Esquive acrobatique I</strong></td>\r\n      <td>Acrobatie: 8+</td>\r\n    </tr>\r\n    <tr>\r\n      <td colspan=\"2\">\r\n        Le personnage gagne une esquive supplmentaire par round, une esquive\r\n        acrobatique est rsolue comme une acrobatie dont le succs\r\n        aboutit aux effets d'une esquive standard. Lors d'une esquive\r\n        acrobatique le personnage subit un malus de 20% sur sa tentative\r\n        d'esquive.\r\n      </td>\r\n    </tr>\r\n    <tr>\r\n      <td><strong>Vol contrl</strong></td>\r\n      <td>Acrobatie: 12+</td>\r\n    </tr>\r\n    <tr>\r\n      <td colspan=\"2\">\r\n        Si une acrobatie visant un autre personnage choue alors l'acteur peut\r\n        se rattraper in-extremis en passant un test d'acrobatie DD 16 afin\r\n        d'annuler tous les effets de la parade ou de l'esquive de la victime.\r\n        Si la victime a intente une esquive ou une parade celle-ci est\r\n        dcompte de son compte d'esquive ou de parade du round en cours.\r\n      </td>\r\n    </tr>\r\n    <tr>\r\n      <td><strong>Esquive acrobatique II</strong></td>\r\n      <td>Acrobatie: 14+</td>\r\n    </tr>\r\n    <tr>\r\n      <td colspan=\"2\">\r\n        Le personnage gagne une esquive supplmentaire par round, une esquive\r\n        acrobatique est rsolue comme une acrobatie dont le succs\r\n        aboutit aux effets d'une esquive standard. Lors d'une esquive\r\n        acrobatique le personnage subit un malus de 20% sur sa tentative\r\n        d'esquive.\r\n      </td>\r\n    </tr>\r\n    <tr>\r\n      <td><strong>Parade acrobatique</strong></td>\r\n      <td>Acrobatie: 16+</td>\r\n    </tr>\r\n    <tr>\r\n      <td colspan=\"2\">\r\n        Le personnage gagne une parade supplmentaire par round, cette parade\r\n        est rsolue comme une acrobatie dont le succs aboutit aux effets d'une\r\n        parade standard.\r\n      </td>\r\n    </tr>\r\n  </tbody>\r\n</table>\r\n"}],
